import { Users } from "../Users/users";

export const Row = ({ ...Users }) => {
  return Users.map((user) => {
    <td>{user.id}</td>;
    <td>{user.name}</td>;
    <td>{user.time}</td>;
    <td>{user.description}</td>;
    <td>{user.done}</td>;
  });
};
